import React from "react";

import { Container, Grid, Paper, Typography, Button } from "@material-ui/core";


const UserHome = () => {

    return (
        <Container>
            <Paper>
                <Grid container>
                    <Grid item md="12">
                        <Typography>
                            No Profile Found
                        </Typography>

                        <Button>CREATE PROFILE</Button>
                    </Grid>
                </Grid>
            </Paper>
        </Container>
    )
}

export default UserHome;
